import React from 'react'
import './directory.components.styles.scss'
import MenuItem from '../menu-item/menu-item.componet';
import shop_data from './directory.data';

class Directory extends React.Component{
    constructor(){
        super();
        this.state={
             sections: shop_data       //importing data from javascript
              }
    }
    render(){
        return(
            <div className="directory-menu">
                {
                this.state.sections.map(({id, ...Othersections})=>(
                    <MenuItem key={id} {...Othersections}/>
                ))
                }
            </div>
        )
    }
}

export default Directory;
